import React from "react";
import "../styles/home.css";

const feedbacks = () => {
    return (

		<iframe
			className="linkedinFeed"
			src="https://www.linkedin.com/embed/feed/update/urn:li:share:7267945244023734274"
			frameborder="0"
			allowfullscreen=""
			title="Embedded post"
		></iframe>
	);
};

export default feedbacks;
